  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Fish and Wildlife Service (Service)
  proposes to acquire up to 20,000 acre-feet of water rights from Newlands Project
  facilities/Carson Division for the maintenance of primary wetland habitat within
  Stillwater National Wildlife Refuge and other Lahontan Valley wetlands. This proposed
  water rights acquisition program is a continuation of an ongoing program that will
  continue through Fiscal Year 1993. The Service is mandated through a number of laws,
  regulations, and international treaties to preserve, protect, enhance, and manage
  natural ecosystems for the benefit of fish and wildlife and their habitat. Water
  rights would be acquired through purchase from willing sellers, leases, or contracts.\",\n\t\"license_title\":
